.c_list_nav {
    float: left;
    box-sizing: border-box;
    user-select: none;

    li {
        float: left;
        cursor: pointer;
        position: relative;
        text-align center;

        span {
            font-family: 'PingFangSC-Regular';
            font-size: 14px;
            letter-spacing: 0;
            text-align: left;
            line-height: 16px;
        }

        &:last-child {
            margin-right: 0;
        }
    }

    .activeLine {
        width: 40px;
        height: 2px;
        position: absolute;
        left: 50%;
        right: 50%;
        transform: translateX(-50%);
        bottom: 0;
    }
}
